/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(this.props.movies);
  }

  render() {
    return (
      <div id="main-movie">
        <div id="main-movie-2">
          <h1>{this.props.movie.original_title}</h1>
          <img
            src={`http://image.tmdb.org/t/p/w342/${this.props.movie.poster_path}`}
            alt="movie poster"
          ></img>
          <table>
            <thead>
              <tr>
                <th>Popularity</th>
                <th>Votes</th>
                <th>IMDB Score</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{Math.floor(this.props.movie.popularity)} %</td>
                <td>{this.props.movie.vote_count}</td>
                <td>{this.props.movie.vote_average}</td>
              </tr>
            </tbody>
          </table>
          <h3>Overview:</h3>
          <h4>{this.props.movie.overview}</h4>
        </div>

        <div id="suggested-movies">
          {this.props.movies.map(
            ({ original_title, vote_average, release_date }) => {
              <ul>
                <li>{original_title}</li>
                <li>{vote_average}</li>
                <li>{release_date}</li>
              </ul>;
            }
          )}
        </div>
      </div>
    );
  }
}

export default MovieList;
